function get_ip()
{
	if (!empty($_SERVER['HTTP_CLIENT_IP'])){
	    $ip=$_SERVER['HTTP_CLIENT_IP'];
	} elseif (!empty($_SERVER['HTTP_X_FORWARDED_FOR'])){
	    $ip=$_SERVER['HTTP_X_FORWARDED_FOR'];
	} else{
	    $ip=$_SERVER['REMOTE_ADDR'];
	}
	return $ip;
}

$data=true;

/* Здесь проверяется существование переменных */
if (isset($_POST['name']) && isset($_POST['phone'])) {
    $name = $_POST['name'];
    $phone = $_POST['phone'];
} else {
    $data=false;
}

if ($data) {
    $country = !empty($_POST['country']) ? strtoupper($_POST['country']) : 'RU';
    $hash = md5($name.$phone);
    if(isset($_COOKIE['verify']) && $_COOKIE['verify'] == $hash) {
        echo iconv("utf-8", "windows-1251", 'Already sent');
        exit();
    }
    setcookie('verify', $hash, time()+120);
	
    $sub_id = !empty($_POST['sub_id']) ? array($_POST['sub_id']) : array();

    $URL = 'http://api.m4leads.com/order/add?';
    $body=array(  
	'fullName'     => isset($_POST['name']) ? $_POST['name'] : 'Заказ обратного звонка',
	'phone'        => isset($_POST['phone']) ? ("+" . preg_replace('/[^0-9\/-]+/', '', $_POST['phone'])) : null,
	'email'        => isset($_POST['email']) ? $_POST['email'] : null,
	'address'      => isset($_POST['address']) ? $_POST['address'] : null,
	'country'      => isset($_POST['country']) ? $_POST['country'] : null,
	'partnerId'    => 293895,
	'offerId'      => 322,
	'access-token' => '71c437d5bf75a76ff5d89c24b567f047',
	'price'        => isset($_POST['price']) ? $_POST['price'] : null,
        'sub_id'       => $sub_id,
	'ipAddress'    => get_ip(),
	'delay'        => isset($_POST['dalay_call']) ? date('Y-m-d H:i:s', strtotime($_POST['dalay_call'])) : ''
    );

    if ($curl = curl_init())
    {
      curl_setopt($curl, CURLOPT_URL, 'http://api.m4leads.com/order/add?'.http_build_query($body));
      curl_setopt($curl, CURLOPT_RETURNTRANSFER, true);
      $result = curl_exec($curl);
      curl_close($curl);

      $res = json_decode($result);
    }
}

