     <script>
        $(function(){

          $('.other__slide-descr').niceScroll({
              cursorcolor:"transparent",
              cursorborder: "none",
              cursorwidth:"0px",
          });


          if($('.owl-carousel').height() == 0){
              $('.other').hide();
          }


         // $('.other').addClass('loaded');


         // Подписка
          // $('#subscribe').on('click', function(e) {
          //   e.preventDefault();

          //   $.ajax({
          //       type: 'POST',
          //       url: 'http://cpa-ds.com/getinfostatick/subscribe.php',
          //       crossDomain: true,
          //       data: $("form").serialize(),
          //       dataType: 'json',
          //       success: function(responseData, textStatus, jqXHR) {
          //         if(responseData.error === true) {
          //            alert('Ошибка! Введите корректный E-mail');
          //         } else {
          //            alert('Подписка успешно оформлена.');
          //            $('#email').val('');
          //         }
          //       },
          //       error: function (responseData, textStatus, errorThrown) {
          //           alert('Ошибка! Повторите попытку позже.');
          //       }
          //   });
          // });

          $('.sub_button').on('click', function(e) {
            var order_id = $('input[name="order_id"]').val();
            var email = $('input[name="email"]').val();

            $.ajax({
              url: 'http://api.m4leads.com/order/set-subscribe',
              type: 'GET',
              dataType: 'json',
              data: 'order_id=' + order_id + '&email=' + email,
              success: function(responseData, textStatus, jqXHR) {
                if (responseData.error === true) {
                  alert('Ошибка! Введите корректный E-mail');
                } else {
                  alert('Подписка успешно оформлена.');
                  $('#email').val('');
                }
              },
              error: function(responseData, textStatus, errorThrown) {
                alert('Ошибка! Повторите попытку позже.');
              }
            });

            return false;
          });


          //custom input

          $('input').on('focus change', function(){
               $(this).next('label').addClass('active');
          });
          $('input').on('blur', function(){
            if($.trim($(this).val()).length <= 0){
               $(this).next('label').removeClass('active');
               $(this).val('');
            }
          });



            $('.owl-carousel:not(.main-slider)').owlCarousel({
               nav: true,
               dots: false,
               navText: "",
               loop: true,
               autoplay: true,
